- level: warning
  msg: "As a principle of best modeling practice, the size of a <compartment> should\
    \ be set to a value rather than be left undefined. Doing so improves the portability\
    \ of models between different simulation and analysis systems, and helps make\
    \ it easier to detect potential errors in models.\n The <compartment> with the\
    \ id 'Feaces' does not have a 'size' attribute, nor is its initial value set by\
    \ an <initialAssignment> or <assignmentRule>.\n"
- level: error
  msg: "In situations where a mathematical expression refers to time, the units of\
    \ time should be consistent with the global time units of the model. In models\
    \ where the 'timeUnits' attribute has not been declared, libSBML does not yet\
    \ have the functionality to verify accurately the consistency of the units in\
    \ such expressions. \n"
